import React, {Component} from 'react'


class ArticleList extends Component {



    constructor(props){
        super(props)
        this.state = {
            list: this.props.list
        }
      }



      render() {
          return (
                <div>
                    <ul>
                    {this.props.list.map(val => (
                        <li>{val.title}</li>
                    ))}
                    </ul>    
              </div>
          )
      }

}

export default ArticleList
